import java.util.*;class Main{public static void main(String[]z){Scanner s=new Scanner(System.in);for(int n,m,i,j,k,x,y;(n=s.nextInt())>0;){int[]a=new int[m=n+s.nextInt()],r={0,0};for(i=x=0;i<m;)x+=a[i++]=s.nextInt();for(r[0]=x,i=0;i<n;++i)for(j=n;j<m;++j){for(k=y=0;k<n;++k)y+=a[k!=i?k:j];if(y*2==x&&r[0]+r[1]>a[i]+a[j])r=new int[]{a[i],a[j]};}System.out.println(r[0]<x?r[0]+" "+r[1]:-1);}}}